import React from 'react'
import './searchInput.css'

export default function SearchInput({ change, value }) {
  return (
    <div className="input_outbox" >
    <div className="fixed-wrapper">
    <input
        className="search_input"
        type="text"
        onChange={change}
        value={value}
        placeholder="Search by name"
      />
    </div>

    </div>
  )
}
